        public delegate int MeshGenerator(EpBlueprint blueprint, MeshGeometry3D mesh, EpbColourIndex[] colours, int faceIndex);

        public static void AddTriangle(Int32Collection triangles, int a, int b, int c)
        {
            triangles.Add(a);
            triangles.Add(b);
            triangles.Add(c);
        }
        public static Point GetUV(EpBlueprint blueprint, EpbColourIndex c, double s, double t)
        {
            Point p = new Point((double)c / (blueprint.Palette.Length - 1), t);
            return p;
        }

